import React from "react";

const Navigation = () =>{
    return(
        <>
            <section className="navigation-section">
                <div className="main-menu">
                    <ul>
                        <li>
                            <a>Home</a>
                            <a>Services</a>
                            <a>About Me</a>
                            <a>Portfolio</a>
                        </li>
                    </ul>
                </div>
            </section>
        </>
    );
}
export default Navigation;
